
import streamlit as st
import requests
from bs4 import BeautifulSoup
import html
import streamlit.components.v1 as components

st.set_page_config(layout="wide")
st.title("やる夫スレ 完全AA対応ビューア（MSゴシックベース）")

yaruo_url = st.text_input("やる夫スレ 過去ログURLを入力してください：", 
    "http://yaruoshelter.com/yaruo001/kako/1542/15429/1542970809.html")

if yaruo_url:
    try:
        headers = { "User-Agent": "Mozilla/5.0" }
        response = requests.get(yaruo_url, headers=headers, timeout=10)
        response.encoding = response.apparent_encoding
        soup = BeautifulSoup(response.text, "html.parser")

        dd_blocks = soup.find_all("dd")
        aa_blocks = [html.unescape(dd.get_text("\n")) for dd in dd_blocks]
        full_text = "\n\n".join(aa_blocks)

        components.html(f"""
        <html>
        <head>
        <style>
        
@font-face {
  font-family: 'MS_PGothic';
  src: url(data:font/woff2;base64,) format('woff2');
  font-weight: normal;
  font-style: normal;
  font-display: swap;
}

        body {
            background-color: #fdfdfd;
            padding: 20px;
        }
        pre {
            font-family: 'MS_PGothic', monospace;
            font-size: 15px;
            line-height: 1.1;
            white-space: pre;
            overflow-x: auto;
            background-color: #f9f9f9;
            border: 1px solid #ddd;
            border-radius: 6px;
            padding: 10px;
            color: black;
        }
        </style>
        </head>
        <body>
        <pre>012345678901234567890123456789
■■■■■■■■■■■■■■■■■■■■■■■■■■■■■</pre>
        <hr>
        <pre>{full_text}</pre>
        </body>
        </html>
        """, height=2400, scrolling=True)

    except Exception as e:
        st.error(f"エラーが発生しました：{e}")
